import Navigation from "./components/NavigationBar.vue";
import AddEmployee from "./components/AddEmployee.vue";
import EmployeeList from "./components/EmployeeList.vue";
import UploadEmployeeList from "./components/UploadEmployeeList.vue";
import 'vuetify/dist/vuetify.css';
export default {
  name: "app",
  components: {
    Navigation: Navigation,
    AddEmployee: AddEmployee,
    EmployeeList: EmployeeList,
    UploadEmployeeList: UploadEmployeeList
  },
  methods: {
    addEmployee: function addEmployee(employee) {
      if (!this.employeeList) {
        this.employeeList = [];
      }

      this.employeeList.push(employee);
    },
    sendNotification: function sendNotification(title, type, text) {
      console.log("Notification");
      this.$notify({
        group: 'app',
        title: title,
        type: type,
        duration: 4000,
        text: text
      });
    }
  },
  computed: {
    liveEmployeeList: function liveEmployeeList() {
      return this.employeeList;
    }
  },
  data: function data() {
    return {
      employeeList: []
    };
  }
};
